                        "Desc": "<color style='color:#FFD780;'>魔女の課題・追加課題</color>を完了すると、アルベドは<color style='color:#FFD780;'>魔導</color>キャラクターになる。チームに魔導キャラクターを2名以上編成すると、<color style='color:#FFD780;'>魔導秘儀</color>効果が発動し、魔導キャラクターが強化される。<br><br><color style='color:#FFD780;'>魔導秘儀</color><br>・元素スキルを発動した後の20秒間、敵に元素スキルダメージを与えると、敵の近くで10秒継続する<color style='color:#FFD780;'>銀華</color>を生成する。フィールド上にアルベド自身が創造した陽華がない時、アルベドが戦闘不能になっていない場合、一つの銀華は陽華と同じように刹那の花を生成する。アルベド自身が創造した銀華は同時に最大2つまで存在可能。<br>・陽華を創造した後の20秒間、周囲のチーム全員の通常攻撃、重撃、落下攻撃、元素スキル、元素爆発ダメージが、アルベドの防御力を基準にアップする。防御力1000毎にダメージ+4%。この方法でアップできるダメージは最大12%まで。<br>・銀華を創造した後の20秒間、周囲のチーム内魔導キャラクターの通常攻撃、重撃、落下攻撃、元素スキル、元素爆発ダメージが、アルベドの防御力を基準にアップする。防御力1000毎にダメージ+10%。この方法でアップできるダメージは最大30%まで。JP0B",
